import "./style.css";

const FindUsHere = () => (
  <div>
    <p className="content_first_social_title">Find us here:</p>
    <ul className="social_list">
      <li className="social_item">FB</li>
      <li className="social_item">TW</li>
      <li className="social_item">INS</li>
      <li className="social_item">PT</li>
    </ul>
  </div>
);

export default FindUsHere;
